//generates face based on input
function inference(input){
    input = tf.tensor(input,[1,64])
    try {
      output = model.predict(input)
    }
    catch(err) {
      alert("Error! You do not have enough memory to perform this computation.");
    }
    output = tf.squeeze(output,)
    output = output.mul(255)
    data = output.dataSync()
    //create a buffer array
    const buffer = new Uint8ClampedArray(64 * 64 * 4)
    //create an Image data var 
    im = new ImageData(64, 64);

    //map the values to the buffer
    var i = 0;
    for(var y = 0; y < 64; y++) {
      for(var x = 0; x < 64; x++) {
        var pos = (y * 64 + x) * 4;      // position in buffer based on x and y
        buffer[pos  ] = data[i]             // some R value [0, 255]
        buffer[pos+1] = data[i+1]           // some G value
        buffer[pos+2] = data[i+2]           // some B value
        buffer[pos+3] = 255;                // set alpha channel
        i+=3
      }
    }

    //set the buffer to the image data
    im.data.set(buffer)
    createImageBitmap(im).then(renderer => ctx.drawImage(renderer, 0,0, 256, 256))
}

//update model variable
function setvariable(net){
  model = net;
}

//load model asynchronously, doesn't wait for user input to load
async function load_model(){
  const net = await tf.loadLayersModel('https://raw.githubusercontent.com/vee-upatising/Anime-DCGAN/master/model.json').then(net => setvariable(net))
}

//repopulate the chart with random data and perform inference with it
function randomData(chart) {
  chart.data.datasets[0].data = Array.from({length: 64}, () => Math.random() * 2 - 1);
  chart.update();
  inference(chart.data.datasets[0].data)
  vals = chart.data.datasets[0].data
}

//repopulate the chart with data from the slider and perform inference with it
function newData(chart, val){
  chart.data.datasets[0].data = val;
  chart.update();
  inference(chart.data.datasets[0].data)
  vals = chart.data.datasets[0].data
}

